import { useState, useEffect } from 'react'
import { getCustomers } from '../services/Api'

function Customer () {
  if (!BackendData) {
    return <h1>Chargement...</h1>
  }

  return (
    <>
      <h1>Customers</h1>
      {/* <RestaurantList restaurants={restaurants} /> */}
      <div>
        {(
          BackendData._id
        )}
      </div>
    </>
  )
}

export default Customer
